import Link from 'next/link';
import { motion } from 'framer-motion';

import styles from './navbar.module.scss';

export default function Navbar({ home }: { home: boolean }) {

  const nav_list = {
    visible: {
      opacity: 1,
      transition: {
        when: "beforeChildren",
        staggerChildren: 0.3,
      },
    },
    hidden: {
      opacity: 0,
      transition: {
        when: "afterChildren",
      },
    },
  }

  return (
    <nav>
      <motion.ul
        className={styles.menu}
        initial="initial"
        animate="animate"
        variants={nav_list}
        transition={{duration: 3}}
      >
        <li className={styles.menu_title}><Link href="/"><a>
            Dads Blog
        </a></Link></li>
        <li><Link href="/">About</Link></li>
        <li><Link href="/"><a>Blog</a></Link></li>
        <li className={styles.dropdown}>
          <Link href="/"><a>Channels</a></Link>
          <ul className={styles.submenu}>
            <li><Link href="/"><a>One</a></Link></li>
            <li><Link href="/"><a>Two</a></Link></li>
            <li><Link href="/"><a>Three</a></Link></li>
          </ul>
        </li>
      </motion.ul>
    </nav>
  );
}
